import React, { Component } from "react";

class Bestselling extends Component {
  constructor(props) {
    super(props);
    this.state = {
      items: this.props.res,
    };
  }

  render() {
    return (
      <div>
        You earned{this.props.totalRev} res {this.state.item}
      </div>
    );
  }
}

export default Bestselling;
